import collectionsimport bisectclass TopVotedCandidate:    def __init__(self, persons, times):        votes = collections.defaultdict(int)        winner = 0        self.winners = [None] * len(times)        self.times = times        for i, person in enumerate(persons):            votes[person] += 1            if votes[person] >= votes[winner]:                winner = person            self.winners[i] = winner    def q(self, t):        return self.winners[bisect.bisect(self.times, t) - 1]persons,times=[0,1,1,0,0,1,0],[0,5,10,15,20,25,30]obj = TopVotedCandidate(persons, times)print(obj.q(24))print(obj.q(8))